import { BusMatrix } from "../components/BusMatrix";
import { FormContact } from "../components/FormContact";

export const DetailPage = () => {
    return (

            <Container>
                <Row>
                    <Col>
                        <BusMatrix/>
                    </Col>
                    <Col>
                        <FormContact/>
                    </Col>
                </Row>
            </Container>

    );
  }
